import React from 'react'
import EastOutlinedIcon from '@mui/icons-material/EastOutlined';
import WestOutlinedIcon from '@mui/icons-material/WestOutlined';



const Slider = () => {
    const data = [
        "img/iot1.jpg",
        "img/iot2.jpg",
        "img/iot3.jpg",

    ];
  return (
    <div className='slider'>
        <div className="container">
            <img src={data[0]}  alt="" />
            <img src= {data[1]} alt="" />
            <img src= {data[2]} alt="" />
        </div>
        <div className="icons">
            <div className="icon">
    <WestOutlinedIcon/>
            </div>
            <div className="icon">
    <EastOutlinedIcon/>
            </div>
        </div>
    </div>
  );
};

export default Slider
